impl Solution {
    pub fn min_groups_for_valid_assignment(nums: Vec<i32>) -> i32 {
        use std::collections::HashMap;

        let mut count_map: HashMap<i32, i32> = HashMap::new();
        for &num in &nums {
            *count_map.entry(num).or_insert(0) += 1;
        }

        let mut counts: Vec<i32> = count_map.values().cloned().collect();
        counts.sort_unstable();

        let mut groups = 0;
        let mut i = 0;
        while i < counts.len() {
            let mut capacity = 1;
            groups += 1;
            while i + 1 < counts.len() && capacity < counts[i + 1] {
                capacity += 1;
                i += 1;
            }
            i += 1;
        }

        groups
    }
}
